import React, { Component } from 'react';

class TopCharts extends Component {

  constructor(props) {
    super(props);
    this.state = {
      items: []
    };
  }

  render() {
    return (
      <div className="top_charts">
        <p>
          {this.state.items}
        </p>
      </div>
    );
  }
}

export default TopCharts;
